import React from 'react';
import { useParams } from 'react-router-dom';
import './TopicsPage.css';

function TopicsPage() {
  let { topicId } = useParams();

  return (
    <div className="topics-page-container">
      <h2 className="topics-title">Temas para: {topicId}</h2>
      {/* Renderiza los temas aquí */}
      <ul className="topics-list">
        {/* Aquí irían los temas como elementos de la lista */}
        <li className="topics-list-item">Tema 1</li>
        <li className="topics-list-item">Tema 2</li>
        {/* etc. */}
      </ul>
    </div>
  );
}

export default TopicsPage;
